import './Layout.css'

import MainCard from './components/Cards/MembersCard/MembersCard.js'
import NavigationBar from '../NavigationBar/NavigationBar'
import React from 'react'

export const Layout = ({ children }) => {
    return (
        <div>
            <NavigationBar />
            <MainCard></MainCard>
            {children}
        </div>
    )
}

export default Layout
